        <div>
            <Container className='header'>
           
           <div className="header-box">
               <p>Brand Name</p>
               <p>Special Promotion</p>
               <p>Whats Your Special Promotion</p>
               <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Dolorem ipsam voluptatem totam</p>
               <button>Primary CTA</button>
           </div>
           <div className="header-box">
               <img style={{width:'30%'}} src={image} alt="" srcset="" />
           </div>
           
       </Container>
        </div>
    )
}

export default Header
